import React from 'react';
import PageWrapper from './componets/PageWrapper';
import Home from './componets/Pages/Home';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
    <PageWrapper>

        <Route
          exact
          path="/"
          component={Home}
        />



    </PageWrapper>
    </Router>
  );
}

export default App;
